import React from "react";
import { Route, Switch, Redirect } from "react-router-dom";
import Main from "./layouts/main";

function App() {
    return (
        <div style={{
            position: "relative",
            display: "flex",
            flexDirection: "column"
        }}>
            <Switch>
                <Route path="/" exact component={Main} />
                <Redirect to="/" />
            </Switch>
        </div>
    );
}

export default App;
